import Layout from "../components/Layout";

const Paints = props => {
  return (
    <Layout>
      <div className="is-main-padding">
        <div className="paint-container">
          <img className="paint" src="/images/paint1.jpg" alt="paint" />
          <div className="paint-info">test</div>
        </div>
        <div className="paint-container">
          <img
            className="paint middle-column"
            src="/images/paint2.jpg"
            alt="paint"
          />
        </div>
        <div className="paint-container">
          <img className="paint" src="/images/paint3.jpg" alt="paint" />
        </div>
        <div className="paint-container">
          <img className="paint" src="/images/paint4.jpg" alt="paint" />
        </div>
        <div className="paint-container">
          <img
            className="paint middle-column"
            src="/images/paint5.jpg"
            alt="paint"
          />
        </div>
        <div className="paint-container">
          <img className="paint" src="/images/paint6.jpg" alt="paint" />
        </div>
        <div className="paint-container">
          <img className="paint" src="/images/paint7.jpg" alt="paint" />
        </div>
      </div>
      <style jsx>
        {`
          .paint-container {
            width: calc((100% - 40px) / 3);
          }
          .paint {
            width: 100%
            margin-bottom: 20px;
            transition: 0.2s;
          }
          .paint:hover {
            filter: contrast(2) brightness(0.7);
            transition: 0.2s;
          }
          .middle-column {
            margin: 0 20px 20px 20px;
          }
        `}
      </style>
    </Layout>
  );
};

export default Paints;
